import pickle
import meerkat
import cv2

file_1=r"C:\Users\silas\Master Project\meerkat raw data\example_files\mk503\file_20231026_082106.mkt"
poses=r"C:\Users\silas\Master Project\pose estimation\mk503\recording_20231026_081936_pose.pkl"
with open(poses, "rb") as f:
            pose_data = pickle.load(f)


average_depth=[]
average_depth_hist=[]
frame_number=0

i=0
filenames=[file_1]
ts1=[]
for file in filenames:
    reader = meerkat.SpeedyReader(file)
    for frame, depth, ir, params in reader:
        depth = cv2.rotate(depth, cv2.ROTATE_90_COUNTERCLOCKWISE)
        timestamp = params["timestamp"]
        ts1.append(timestamp)
        shifted_timestamps_poses = [x - timestamp for x in pose_data["timestamps"]]
        nearest_timestamp_index = np.abs(shifted_timestamps_poses).argmin()

        # extract positions from pkl file dictionary
        left_shoulder_x = pose_data["locations"][nearest_timestamp_index][0][0]
        left_shoulder_y = pose_data["locations"][nearest_timestamp_index][0][1]
        right_shoulder_x = pose_data["locations"][nearest_timestamp_index][1][0]
        right_shoulder_y = pose_data["locations"][nearest_timestamp_index][1][1]
        left_hip_x = pose_data["locations"][nearest_timestamp_index][2][0]
        left_hip_y = pose_data["locations"][nearest_timestamp_index][2][1]
        right_hip_x = pose_data["locations"][nearest_timestamp_index][3][0]
        right_hip_y = pose_data["locations"][nearest_timestamp_index][3][1]

        rectangle_y_1 = int(min(left_shoulder_y, right_shoulder_y))
        rectangle_y_2 = int(max(left_hip_y, right_hip_y))
        rectangle_x_2 = int(max(left_hip_x, left_shoulder_x))
        rectangle_x_1 = int(min(right_shoulder_x, right_hip_x))
        ROI_y_depth = rectangle_x_2 - rectangle_x_1
        ROI_x_depth = rectangle_y_2 - rectangle_y_1
        region_of_interest_data_depth=[]
        for l in range(ROI_y_depth):
                for m in range(ROI_x_depth):
                    if depth[l + rectangle_y_1][m + rectangle_x_1] > 0:
                        region_of_interest_data_depth.append( int(depth[l + rectangle_y_1][
                            m + rectangle_x_1
                        ]))
        
        peak=np.bincount(region_of_interest_data_depth).argmax()
        median=np.median(region_of_interest_data_depth)
       
        region_of_interest_data_depth=np.array(region_of_interest_data_depth)
        average_depth.append(np.mean(region_of_interest_data_depth))                
        frame_number+=1
        print(frame_number)
        #print(np.bincount(region_of_interest_data_depth).argmax())
       
        
        center=peak
        
        depth_corrected=[]
        for i in range(len(region_of_interest_data_depth)):
            if region_of_interest_data_depth[i]>center-25 and region_of_interest_data_depth[i]<center+25:
                depth_corrected.append(region_of_interest_data_depth[i])
        average_depth_hist.append(np.mean(np.array(depth_corrected)))
        if frame_number>400:
            break



